import React from "react";
import { gql, useQuery } from "@apollo/client";

const allBooks = gql`
  query {
    allBooks {
      title
      published
    }
  }
`;

const Books = (props) => {
  if (!props.show) {
    return null;
  }

  const books = [];

  return (
    <div>
      <h2>books</h2>

      <table>
        <tbody>
          <tr>
            <th></th>
            <th>author</th>
            <th>published</th>
          </tr>
          {books.map((a) => (
            <tr key={a.title}>
              <td>{a.title}</td>
              <td>{a.author}</td>
              <td>{a.published}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Books;
